import React, { Component } from 'react'

class Register extends Component {
    
    constructor(props) {
        super(props)
    
        this.state = {
             emailfield: "",
             passwordfield: "",
        }
    }
    
    
    render() {
        return (
            <div>
                <h1>Register A New Account</h1>
                <form>
                    {/* Email Registration */}
                    <div>
                        <label htmlFor="registeremailinput" className = "form-labels">Email Address</label>
                        <input id="registeremailinput" type="text" value={this.state.email} onChange = {this.handleEmailRegistration}></input>
                    </div>
                    
                    {/* Password Registration */}
                    <div>
                        <label htmlFor ="registerpassword" className = "form-labels">Password</label>
                        <input id="registerpassword" type="password" value={this.state.password} onChange={this.handlePasswordRegistration}></input>
                    </div>
                    
                    {/* Submit Button */}
                    <div>
                        <button type="submit">Submit</button>
                    </div>
                </form>
            </div>
        )
    }
}

export default Register
